import React from "react"; 
import {Card} from "react-bootstrap";

const Back = (props) => {

    return(
        <Card>
            <Card.Img variant="top" src= {require("./back.png")} /> This is the back of the card. {props.src}
        </Card>
    )
}

export default Back;
